-- Dumping data for table stampqr.faq: ~8 rows (approximately)
INSERT INTO `faq` (`id`, `question`, `answer`, `category`, `content_active`, `create_date`) VALUES
	(22, 'What is a QR Code?', 'A Quick Response (QR) code is a two-dimensional barcode that can store information. QR codes consist of black squares arranged on a white square grid.', 'General', 1, '2023-11-01 20:49:25'),
	(23, 'How can I scan a QR Code?', 'The codes can be scanned using a smartphone or a QR code reader, which interprets the code and retrieves the information stored within it.', 'General', 1, '2023-11-01 20:49:27'),
	(27, 'Why should I use QR Codes?', 'They were developed for tracking automotive parts during manufacturing making them ideal for product tracking and traceability.', 'General', 1, '2023-11-01 20:49:28'),
	(28, 'How do QR codes differ from barcodes?', 'Although they serve similar purposes, QR codes have some advantages over barcodes. \r\nData Capacity: QR codes can store much more data than traditional barcodes. Barcodes typically store 20-25 characters, whereas QR codes can store up to a few thousand characters of data.\r\nScanning: QR codes can be scanned from any angle while traditional barcodes require a specific orientation to be scanned accurately.\r\nError Correction: QR codes have built-in error correction capabilities, allowing them to remain readable even if part of the code is damaged or obscured. Barcodes do not have built-in error correction, making them more susceptible to readability issues in case of damage.\r\n', 'General', 1, '2023-11-01 20:51:34'),
	(29, 'How does your system work?', 'Our system encodes data onto a QR code stamp. The stamp can be reset and encoded again in case the information needs to change.', 'General', 1, '2023-11-01 20:49:30'),
	(30, 'How can I create a QR code?', 'Our administrators will create an account for you that will provide you with access to our web portal. Once logged in QR codes can be generated on the user landing page.', 'General', 1, '2023-11-01 20:49:30'),
	(31, 'How can I get QR codes to the encoder?', 'Once a QR code has been created it can be assigned to a mobile user. The mobile user can download an application from the play store, once logged in on the app they will be able to see all active QR codes assigned to them. Therse codes can then be transmitted to the encoder via Bluetooth.', 'General', 1, '2023-11-01 20:49:31'),
	(32, 'How can I create mobile users?', 'Once your account to our web portal has been created, mobile users can be registered on the landing page.', 'General', 1, '2023-11-01 20:49:32'),
	(33, 'Why is your product more sustainable than using labels?', 'Our product generates a stamp that can be reused numerous times, no additional labels are required. The stamp can then use a traditional ink pad. ', 'General', 1, '2023-11-01 20:49:33'),
	(35, 'How many QR code versions are there', 'There are 40 QR code versions', 'General', 1, '2023-11-05 10:40:38');

